// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

import "./IChilliSwap.sol";


contract ChilliSwap is ERC721, IChilliSwap,Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    // uint256 public constant DAY = 86400;
    // uint256 public constant FIFTEEN_MINUTES = 900;

    // uint256 public constant AUCTION_TIME = DAY;
    // uint256 public constant LAST_BIDDER_RESET_TIME = FIFTEEN_MINUTES;

    // uint256 public FEE = 15;
    // uint256 public TOKEN_FEE = 15;
    // uint256 public NEXT_BID_PERCENTAGE = 5;
    // address public TOKEN_ADDRESS;

    //Hashes helps to prevent from using the same hash
    mapping(string => uint8) hashes;
    mapping(uint256 => Artwork) private artworks;
    mapping(address => uint8) private creators;
    //mapping(uint256 => Auction) private auctionList;

    constructor() ERC721("ChilliSwap", "CSWP") {}


    function mintNFT(address recipient, string memory _metadata, string memory _artwork,  uint256 _royalty ) public override returns (uint256) {
        require(hashes[_metadata] != 1);
        require(hashes[_artwork] != 1);
        require(creators[msg.sender] == 1, "ChilliSwap: be a creator");

        hashes[_metadata] = 1;
        hashes[_artwork] = 1;

        _tokenIds.increment();
        uint256 newItemId = _tokenIds.current();
        _safeMint(recipient, newItemId);

        artworks[newItemId] = Artwork(block.timestamp, msg.sender, _metadata,  _royalty);
        emit Mint(recipient, newItemId, _artwork);
        return newItemId;
    }

    function getArtwork(uint256 _tokenId) public view override returns (Artwork memory){
        require( _exists(_tokenId), "ERC721: approved query for nonexistent token" );
        return artworks[_tokenId];
    }

    function addCreator(address _address) public override onlyOwner returns(bool){
        require(creators[_address] != 1, "ChilliSwap: creator already exist");
        creators[_address] = 1;
        return true;
    }
    function removeCreator(address _address)  public  override onlyOwner returns(bool){
        require(creators[_address] == 1, "ChilliSwap: creator doesn't exist");
        creators[_address] = 0;
        return true;
    }
